int main() {
    // A company invited 24 people to a luncheon, but 10 of them didn't show up. If the tables they had held 7 people each, how many tables do they need?
    int people_invited = 24;
    int people_not_showed = 10;
    int people_present = people_invited - people_not_showed;

    int table_capacity = 7;
    int tables_needed = (people_present + table_capacity - 1) / table_capacity; // Using ceiling division

    int result = tables_needed;

    std::cout << result;

    return 0;
}
